    n, m, s = map(int, input().split())
    graph = [[] for i in range(n)]
    for i in range(m):
        t, u, v = map(int, input().split())
        graph[u-1].append((t, v-1))
        if t == 2:
            graph[v-1].append((t, u-1))
    visited = [False] * n
    visited[s-1] = True
    stack = [s-1]
    while stack:
        v = stack.pop()
        for t, u in graph[v]:
            if t == 2 and not visited[u]:
                visited[u] = True
                stack.append(u)
    print(sum(visited))
    for t, u in graph[s-1]:
        if t == 2:
            print('+' if visited[u] else '-')

